import React from "react";
export default function Box(props) {
  const [on, setOn] = React.useState(props.on);

  const styles = {
    background: on ? "#222222" : "aqua",
  };
  function toggle() {
    setOn((prevOn) => !prevOn);
  }

  return <div  style={styles} className="box"></div>;
}
